import React, { useState } from "react";

const App = () => {
    
    let newTime = new Date().toLocaleTimeString();

    const [ctime, setCtime] = useState (newTime);

    const UpdateTime = () => {

        UpdateTime = new Date().toLocaleTimeString();

    }

    return (
        <>
        <h1> {ctime} </h1>
        <button onClick={UpdateTime}> Get Time</button>
        </>
    
    );

};
export default App;
